import React from "react";
import latestProductShopContent from "./latestProductShopContent";
import Container from "../other/Container";

function latestProductShopLayout({ data, containerType }) {
  return (
    <div className="shop-layout">
      <Container type={containerType}>
        <latestProductShopContent data={data} />
      </Container>
    </div>
  );
}

export default React.memo(latestProductShopLayout);
